import { Grid, Typography, Box } from "@material-ui/core"
import { Property } from "../../../generated/graphql"

interface Props {
    property: Property
}

export const PropertySelectionView:  React.FC<Props> = (Props) => { 
    const serverAdress = "http://localhost:4000/"

    const property = Props.property;

    console.log(property.images[0])

    if(property){
        return (
        <div>
            <Grid container>
                <Grid item xs={3}>
                    <Box width={100}>               
                        <img alt={"testbild"} src={serverAdress + property.images[0]} width={"200px"}/>
                    </Box>
                </Grid>
                <Grid item xs={6}>
                    <Typography variant="h6">
                        {Props.property.title}
                    </Typography>
                    <Typography variant="subtitle2">
                        {Props.property.subtext}
                    </Typography>
                    <Typography variant="body2">
                        {Props.property.location}
                    </Typography>
                </Grid>
            </Grid>
        </div>)
    } 

    return (<div>keine Unterkunft ausgew√§hlt</div>)
}
